import React from "react";
import styled from "styled-components";

const ProductDescription = (props) => {
  const Wrapper = styled.div`
    background-color: #02193b;
    color: white;
    padding: 10px 30px;
    font-size: 12px;
  `;
  return (
    <Wrapper>
      <h3>Description</h3>
      <p>{props.data}</p>
    </Wrapper>
  );
};

export default ProductDescription;
